/**********************************************************************
 *  Deduplicate contacts by email & drop empties
 *  Input:  items[] (each item = { json: { … } })
 *  Output: one item per unique, non-empty email
 **********************************************************************/
const normEmail = e => (typeof e === 'string' ? e.trim().toLowerCase() : '');

const seen  = new Set();
const clean = [];

for (const itm of items) {
  // Handle both flat and nested structures
  const data   = itm.json.output ?? itm.json;   // supports {output:{…}} too
  const email  = normEmail(data.email);

  if (!email || seen.has(email)) continue;      // skip blanks & dupes

  seen.add(email);
  clean.push({
    json: {
      name:  data.name  ?? null,
      email // already normalised
    }
  });
}

return clean;
